import React from "react";

let Sides = (props) => {
  let source = props.source;
  console.log(source);
  return (
    <div className="image-container" style={{ display: "flex", alignItems: "center" }}>
      <img src={source} alt="Image" style={{ maxWidth: "100%", height: "auto" }} />
    </div>
  );
};

export default Sides;
